<h2 id="description">Description</h2>
<div class="description"><div class="-cachefactory-page -cachefactory-iid-page"><p>This error occurs when trying to create a new <code>code</code> object via <a href="api/ng.$cacheFactory"><code>code</code></a> with an ID that was already used to create another cache object.</p>
<p>To resolve the error please use a different cache ID when calling <code>code</code>.</p>
